import { useEffect, useState } from "react";

function NotFound() {
  const [arr, setArr] = useState([1, 2, 3, 4, 5]);

  useEffect(() => {
    const b = arr.push(6);
    setArr(b);
  }, []);

  return (
    <>
      {arr.map((item) => {
       return <span>{item}</span>;
      })}
    </>
  );
}
export default NotFound;
